import React from "react"
import ReactDOM from "react-dom"
import './styles.css';

function Imagedata() {
    var img1 = require('./az.jpg')
    var img2 = require('./joey.jpg')
    var img3 = require('./deftones.jpg')
    var img4 = require('./fa.jpg')
    var img5 = require('./nas.jpg')
    var img6 = require('./denzel.jpg')
    var img7 = require('./primer.jpg')
    var img8 = require('./vangelis.jpg')

    return (
        <div>
            <body>
                <div>
                    <h1>Image</h1>
                        <div>
                            <img src = {img1.default} alt="Image" height="300" width="300"/>
                        </div>
                    <img src = {img2.default} alt="Image" height="300" width="300"/>
                    <img src = {img3.default} alt="Image" height="300" width="300"/>
                    <img src = {img4.default} alt="Image" height="300" width="300"/>
                    <img src = {img5.default} alt="Image" height="300" width="300"/>
                    <img src = {img6.default} alt="Image" height="300" width="300"/>
                    <img src = {img7.default} alt="Image" height="300" width="300"/>
                    <img src = {img8.default} alt="Image" height="300" width="300"/>
                </div>
            </body>
        </div>
    )
}

export default Imagedata
